import sys

sys.path.append("../py")

from idiotfest import *


def test():

    juri = get_juri()
    
    for carrier in get_attendees():
        juri.append_attendee(IdiotFestAttendee(carrier))
        
    juri.train_judges()   

    sortrd_jadges = sorted(juri._judges, \
                       key = lambda fad_name: juri._judges[fad_name]["score"], \
                       reverse = True)

    for fad_name in sortrd_jadges:
        print("{:25}".format(fad_name), \
              "{:>10}".format("{:.3f}".format(juri._judges[fad_name]["score"], 3)), \
              "{:>10}".format("{:.3f}".format(juri._judges[fad_name]["weight"], 3)))


def get_juri():

    juri = IdiotFestJuri("rate")
    juri.append_judge(AttrIdiot("legal_entity"))
    juri.append_judge(AttrIdiot("city"))
    juri.append_judge(NumericIdiot("year_registered"))
    juri.append_judge(NumericIdiot("authorized_capital"))
    juri.append_judge(NumericIdiot("number_of_owners"))
    juri.append_judge(NumericIdiot("last_year_revenu"))
    juri.append_judge(NumericIdiot("number_of_tracks"))
    juri.append_judge(NumericIdiot("number_of_drivers"))
    juri.append_judge(NumericIdiot("drivers_median_salary"))

    juri.margin = 0.7

    return juri


